import React from "react";

const Submission = ({imgsrc, para, bg, imgbg, color}) =>{
    return(
        <div className="col-lg-6 col-md-12 sub_mission" style={{backgroundColor: bg, color: color}} data-aos="fade-up-right">
        <div className="mission-img" style={{backgroundColor: imgbg}}>
        <img src={imgsrc} alt="" />
        </div>
        <p>{para}</p>


        </div>

    )
}

export default Submission;
